import React, { useState } from 'react'
import Logo from '../../assets/logo.png'
import './headerNonAuth.css'
import { Button, Modal, ModalHeader, ModalBody, ModalFooter, Input, Label, FormGroup, } from 'reactstrap'

const HeaderNonAuth = () => {
    const [modalRegist, setModalRegist] = useState(false);
    const toggleRegist = () => setModalRegist(!modalRegist);

    const [modalLogin, setModalLogin] = useState(false);
    const toggleLogin = () => setModalLogin(!modalLogin);

    return (
        <nav class="navbar navbar-expand-lg">
           <img class="Logo" src={Logo} />
            <div class="collapse navbar-collapse" id="navbarSupportedContent">
                <span class="nav-link" href="#">Home</span>
                <span class="nav-link" href="#">About</span>
                <span class="nav-link" href="#">Browse</span>
            </div>
        </nav>
    )
}

export default HeaderNonAuth
